@Injectable({
  providedIn: 'root'
})
export class DatosPService {

  constructor(private http: HttpClient) { }
  domain: string="http://localhost:3000/";
  getDatosP() {
    return this.http.get<DatosPModel[]>(`${this.domain}/api/datosP`).pipe(
      map(res => res)
